import React from "react"

export default function Social(props) {
  const iconToRender = `fa-brands ${socialIcon}`
  const socialAddress = { socialLink }
  console.debug("iconToRender", iconToRender)

  return (
    <li className="social-list__item">
      <a
        clasName="social-list__link"
        href={socialAddress}
        target="_blank"
        rel="noreferrer">
        <i class={iconToRender} />
      </a>
    </li>
  )
}
